import React from "react";

function Projects() {
  return (
    <div id="projects">
      <h3>Projects</h3>
      <p>
        <strong>Developer, AllergenAlert.co (ElleHacks) - 2024</strong>
        <br />
        Built a website to identify allergen trees based on user location,
        integrating government data of over 600,000 entries specific to the
        Toronto area.
      </p>
      <p>
        <strong>Personal Portfolio Website</strong>
        <br />
        Showcasing skills and projects with a focus on front-end development.
        HTML, CSS, JavaScript, and React.
      </p>
    </div>
  );
}

export default Projects;
